import './App.css'; 
import NavScrollExample from './navbar'
// import { Navbar } from 'react-bootstrap'; 
// import { Carousel } from 'react-bootstrap'; 
import IndividualIntervalsExample  from './carousel';

function App() {
  return ( 
    <>
      <NavScrollExample/>    
        <div name = 'PenguinContainer'>
              <IndividualIntervalsExample name = 'PenguinContainer'/>
          <div class = "span">
            <span>
              <p>Penguins Penguins PenguinsPenguinsPenguins</p>
            </span>
          </div>
        </div>

    </>

  );
}

export default App;
